‘Animals I will miss’ is  the title for my offering for the upcoming group show in #portland ———————————‘EXISTENTIAL’ will showcase the work of over 70 internationally renowned artists with 10% of all sales being donated to Born Free USA (@bornfreeusaorg) to help raise awareness and funds for our world’s endangered species.

Curated by @thinkspace_art @antlerpdx and @talongallery

Well over 100 works of art will be on view across both spaces. Full details regarding the collector preview will be shared soon.

Opening on Thursday, April 27 with a reception from 6-9pm in Portland at both Antler and Talon.

